  false,\n\t\"url\": null,\n\t\"notes\": \"Images contain station history information
  for 175 stations in the National Water Level Observation Network (NWLON). The NWLON
  is a network of long-term, continuously operating water-level stations throughout
  the USA, including its island possessions and territories and the Great Lakes. NWLON
  stations are the foundation for reference stations for NOAA's tide prediction products,
  and serve as controls in determining tidal datums for all short-term water-level
  stations. Additional histories for approximately 6,000 secondary and tertiary stations
  are also included, but are likely incomplete due to defunding of the task prior
  to completion. Images created through a Climate Database Modernization Program task
  in partnership with NOAA's National Ocean Service, Center for Operational Oceanographic
  Products and Services (CO-OPS)/Requirements and Development Devision. The task leader
  was oceanographer Thomas F. Landon, and then Manoj R. Samant. Scanning began with
  a pilot in fall 2003, and continued through early 2011.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
